import React, { useState, useEffect } from 'react';

const Tour = (props) => {

  const id = props.id;

  function deleteTour() {
    delete props.data[id];
    console.log(props.data[1]);
  }

  return (
    <div className="single-tour">
      <img src={props.data[id].image} />
      <h3>{props.data[id].name}</h3>
      <h4 className="tour-price">${props.data[id].price}</h4>
      <h5 className="tour-info">{props.data[id].info}</h5>
      <button className="delete-btn"
              onClick={deleteTour}>Not interested</button>
    </div>
  );
};

export default Tour;
